import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  Button,
  Stack,
  IconButton,
  Divider,
  Card,
  TextField,
  Typography,
  InputAdornment,
  OutlinedInput,
  FormControl,
  InputLabel,
} from "@mui/material";
import {
  Visibility,
  DirectionsCar,
  BarChart,
  AttachMoney,
  Email,
  Apartment,
  DateRange,
} from "@mui/icons-material";

export default function Main({ name }) {
  const [todo, setTodo] = useState("");
  let navigate = useNavigate();
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        background: "linear-gradient(to right top,cadetblue,lavenderblush)",
      }}
    >
      {/* <div style={{ display: "flex", justifyContent: "center" , flex: }}> */}
      <Typography
        style={{
          fontSize: "2rem",
          fontFamily: "gillsans",
          marginTop: "10%",
          color: "crimson",
        }}
      >
        TODOS
      </Typography>
      <FormControl>
        <InputLabel htmlFor="outlined-adornment-password">What needs to be done?</InputLabel>
        <OutlinedInput
          id="outlined-basic"
        //   label="What needs to be done?"
          // variant="outlined"
          style={{ marginTop: "1%", width: "20vw" }}
          onChange={(e) => setTodo(e.target.value)}
          endAdornment={
            <InputAdornment position="end">
              <IconButton
                aria-label="toggle password visibility"
                //   onClick={handleClickShowPassword}
                //   onMouseDown={handleMouseDownPassword}
                edge="end"
              >
                <Visibility />
              </IconButton>
            </InputAdornment>
          }
        />
      </FormControl>
      {/* </div> */}
    </div>
  );
}
